import React, { useState, useEffect } from "react";
import { useNavigate, Link, useLocation } from "react-router-dom";
import { Icon } from "@iconify/react";

const WalletPage = () => {
  const [cards, setCards] = useState([]);
  const [newCardNumber, setNewCardNumber] = useState("");
  const [expiryMonth, setExpiryMonth] = useState("");
  const [expiryYear, setExpiryYear] = useState("");
  const [cvc, setCvc] = useState("");
  const [cardHolder, setCardHolder] = useState("");
  const [cardType, setCardType] = useState("");
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);

  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem("user"));
    if (!storedUser) {
      navigate("/login");
    } else {
      setUser(storedUser);
      fetchCards(storedUser.token, storedUser._id);
    }
  }, [navigate]);

  const fetchCards = async (token, userId) => {
    setLoading(true);
    try {
      const response = await fetch("http://localhost:5000/api/cards", {
        headers: { Authorization: `Bearer ${token}` },
      });
      const data = await response.json();
      const userCards = Array.isArray(data) ? data.filter(card => card.userId === userId) : [];
      setCards(userCards);
    } catch (error) {
      console.error("Erreur lors de la récupération des cartes:", error);
      setCards([]);
    } finally {
      setLoading(false);
    }
  };

  const detectCardType = (number) => {
    const visaRegex = /^4/;
    const masterCardRegex = /^5[1-5]/;
    if (visaRegex.test(number)) return "Visa";
    if (masterCardRegex.test(number)) return "MasterCard";
    return "";
  };

  const handleCardNumberChange = (e) => {
    const number = e.target.value.replace(/\D/g, "").slice(0, 16);
    setNewCardNumber(number);
    setCardType(detectCardType(number));
  };

  const addCard = async () => {
    if (!user || !user._id) {
      alert("Utilisateur non trouvé, veuillez vous reconnecter.");
      return;
    }

    const newCard = {
      userId: user._id,
      holder: cardHolder.trim(),
      number: newCardNumber.trim(),
      expiryMonth: expiryMonth.trim(),
      expiryYear: expiryYear.trim(),
      cvc: cvc.trim(),
      type: cardType,
    };

    try {
      const response = await fetch("http://localhost:5000/api/cards", {
        method: "POST",
        headers: { 
          "Content-Type": "application/json",
          Authorization: `Bearer ${user.token}`
        },
        body: JSON.stringify(newCard),
      });

      const data = await response.json();
      if (!response.ok) throw new Error(data.message);

      alert("Carte ajoutée avec succès !");
      fetchCards(user.token, user._id);
    } catch (error) {
      console.error("Erreur lors de l'ajout :", error.message);
    }
  };

  return (
    <div>
      <h2>💳 Mon Portefeuille</h2>
      <input
        type="text"
        value={newCardNumber}
        onChange={handleCardNumberChange}
        placeholder="Numéro de carte (16 chiffres)"
        maxLength="16"
      />
      <p>Type de carte : {cardType}</p>
      <input
        type="text"
        value={expiryMonth}
        onChange={(e) => setExpiryMonth(e.target.value.replace(/\D/g, "").slice(0, 2))}
        placeholder="MM"
        maxLength="2"
      />
      <input
        type="text"
        value={expiryYear}
        onChange={(e) => setExpiryYear(e.target.value.replace(/\D/g, "").slice(0, 2))}
        placeholder="YY"
        maxLength="2"
      />
      <input
        type="text"
        value={cvc}
        onChange={(e) => setCvc(e.target.value.replace(/\D/g, "").slice(0, 4))}
        placeholder="CVC (3-4 chiffres)"
        maxLength="4"
      />
      <input
        type="text"
        value={cardHolder}
        onChange={(e) => setCardHolder(e.target.value)}
        placeholder="Nom du propriétaire"
      />
      <button onClick={addCard}>Ajouter</button>
    </div>
  );
};

export default WalletPage;
